Backbone.CompositeView = Backbone.View.extend({
	addSubview: function(selector, subview){
		var selectorSubviews = 
			this.subviews()[selector] || (this.subviews()[selector] = []);

		selectorSubviews.push(subview);

		var $selectorEl = this.$(selector);
		$selectorEl.prepend(subview.$el);
	},

	remove: function(){
		Backbone.View.prototype.remove.call(this);

		//remove all subviews
		_(this.subviews()).each(function(selectorSubviews, selector){
			_(selectorSubviews).each(function(subview){
				subview.remove();
			});
		});
	},

	removeSubview: function(selector, subview){
		var selectorSubviews =
			this.subviews()[selector] || (this.subviews()[selector] = []);

		var subviewIndex = selectorSubviews.indexOf(subview);
		selectorSubviews.splice(subviewIndex, 1);
		subview.remove();
	},

	renderSubviews: function(){
		var view = this;

		_(this.subviews()).each(function(selectorSubviews, selector){
			var $selectorEl = view.$(selector);
			$selectorEl.empty();

			_(selectorSubviews).each(function(subview){
				$selectorEl.append(subview.render().$el);
				subview.delegateEvents();
			});
		});
	},

	subviews: function(){
		if (!this._subviews){
			this._subviews = {};
		}
		return this._subviews;
	}
});
Curate.PaginatedView = {

  listenForScroll: function(){
		$(window).off('scroll'); //remove previous listeners
		var throttledCallback = _.throttle(this.nextPage.bind(this), 200);
		$(window).on('scroll', throttledCallback);
	},

	nextPage: function () {
	    var view = this;
	    if (this.$('.spinner').visible()) {
	    	if(view.collection.page_number < view.collection.total_pages){
	    		view.collection.fetch({
	    			data: {page: view.collection.page_number + 1},
	    			remove: false
	    		});
	    	} else {
	    		view.$('.spinner').remove();
	    	}
	    }     
	}
};
Curate.NestedPaginate = {
  // I set an interval-based callback to nextPage in my child views.

  nextPage: function (collection) {
    var self = this;
    if (this.$('.spinner').visible()) {
      if (collection.page < collection.total_pages) {
        collection.fetch({
          data: { page: parseInt(collection.page) + 1 },
          remove: true,
          wait: true
        });
      } else {
        self.$('.spinner').remove();
      }
    }
  }
};
