window.Curate.Views.PostsNew = Backbone.CompositeView.extend({

	template: JST['posts/new'],

	events: {
		'submit form': 'submit',
		'click #post-body': 'loading'
	},

	loading: function(){
		$('#post-body').preview({key:'77b9e769557a490e9e2ef087981131c3'});
		$('#post-body').on('loading', function(){
		$('.loading').show();
		$('.selector-wrapper').html('<div class="spinner_post"><div class="bounce1"></div><div class="bounce2"></div><div class="bounce3"></div></div>');

		});
	}, 

	initialize: function(options){
		this.post = options.post;
	},

	render: function(){
		var renderedContent = this.template();
		this.$el.html(renderedContent);
		

		return this;
	},

	submit: function(event){
		event.preventDefault();
		var view = this;

		var params = $(event.currentTarget).serializeJSON()['post'];
		var newPost = new Curate.Models.Post(params);
		newPost.save({}, {
			success: function(){
				console.log('success');
				view.post.posts().unshift(newPost);
				
				view.render();

				Curate.Flash.success('Post success!');
				
				
			}
		});
	}

});
window.Curate.Views.PostsShow = Backbone.View.extend({
	
	template: JST['posts/show'],

	events: {
		'click #delete-post': 'destroy',
		'click #like': 'toggleLike'
	},

	destroy: function(event){
		if(confirm('Are you sure?')){	
			this.model.destroy();
			Curate.Flash.warning('Post deleted');
		}	
	},

	toggleLike: function (event) {
	    $.ajax('/api/posts/' + this.model.id + '/togglelike', {
	      type: 'POST',
	      success: function (response) {
	        this.model.set('is_liked', response.is_liked);
	        this.model.set('num_likes', response.num_likes);
	        this.render();
	      }.bind(this),
	      error: function () {
	        console.log('Something went wrong!');
	      }
	    });
	},

	render: function(){
		var renderedContent = this.template({
			post: this.model
		});

		this.$el.html(renderedContent);
		return this;
	}
});
